import React, { Component } from 'react';

class ParsingNav extends Component {
    render() {
        return (
            <div class="btn-group-vertical">
                <button type="button" class="btn center btn-outline-secondary btn-lg mt-3">Показать предобработанный текст</button>
                <button type="button" class="btn btn btn-outline-secondary btn-lg mt-3">Выделить синдромы</button>
                <button type="button" class="btn btn btn-outline-secondary btn-lg mt-3">Выделить симптомы</button>
            </div>
        );
    }
}

export default ParsingNav;
